DROP TABLE IF EXISTS match_info;

create table match_info
(
    match_id                             UInt64,
    start_time                           DateTime,
    winning_team                         Enum8('Team0' = 0, 'Team1' = 1, 'Spectator' = 16),
    duration_s                           UInt32,
    match_outcome                        Enum8('TeamWin' = 0, 'Error' = 1),
    match_mode                           Enum8('Invalid' = 0, 'Unranked' = 1, 'PrivateLobby' = 2, 'CoopBot' = 3, 'Ranked' = 4, 'ServerTest' = 5, 'Tutorial' = 6, 'HeroLabs' = 7),
    game_mode                            Enum8('Invalid' = 0, 'Normal' = 1, 'OneVsOneTest' = 2, 'Sandbox' = 3),
    sample_time_s                        Array(UInt32),
    stat_type                            Array(Int32),
    source_name                          Array(String),
    objectives_mask_team0                UInt16,
    objectives_mask_team1                UInt16,
    `objectives.destroyed_time_s`        Array(UInt32),
    `objectives.creep_damage`            Array(UInt32),
    `objectives.creep_damage_mitigated`  Array(UInt32),
    `objectives.player_damage`           Array(UInt32),
    `objectives.player_damage_mitigated` Array(UInt32),
    `objectives.first_damage_time_s`     Array(UInt32),
    `objectives.team_objective`          Array(Enum8('Core' = 0, 'Tier1Lane1' = 1, 'Tier1Lane2' = 2, 'Tier1Lane3' = 3, 'Tier1Lane4' = 4, 'Tier2Lane1' = 5, 'Tier2Lane2' = 6, 'Tier2Lane3' = 7, 'Tier2Lane4' = 8, 'Titan' = 9, 'TitanShieldGenerator1' = 10, 'TitanShieldGenerator2' = 11, 'BarrackBossLane1' = 12, 'BarrackBossLane2' = 13, 'BarrackBossLane3' = 14, 'BarrackBossLane4' = 15)),
    `objectives.team`                    Array(Enum8('Team0' = 0, 'Team1' = 1, 'Spectator' = 16)),
    `mid_boss.team_killed`               Array(Enum8('Team0' = 0, 'Team1' = 1, 'Spectator' = 16)),
    `mid_boss.team_claimed`              Array(Enum8('Team0' = 0, 'Team1' = 1, 'Spectator' = 16)),
    `mid_boss.destroyed_time_s`          Array(UInt32),
    is_high_skill_range_parties          Nullable(Bool),
    low_pri_pool                         Nullable(Bool),
    new_player_pool                      Nullable(Bool),
    average_badge_team0                  Nullable(UInt32),
    average_badge_team1                  Nullable(UInt32),
    created_at                           DateTime default now(),
    game_mode_version                    Nullable(UInt32)
)
    engine = ReplacingMergeTree PRIMARY KEY match_id
        ORDER BY match_id
        SETTINGS index_granularity = 8192;

